### Describe the bug
Defining kernelPatches in linuxManualConfig applies the patch but not extraStructuredConfig nor extraConfig

### Steps To Reproduce
Steps to reproduce the behavior:
config: 
```nix
custom = let
    baseKernel = pkgs.linux;
    suffix = "-bore";
  in (pkgs.linuxManualConfig {
    inherit (baseKernel) src;
    modDirVersion = "${baseKernel.modDirVersion}${suffix}";
    version = "${baseKernel.version}${suffix}";
    allowImportFromDerivation = true;

    # generated using modprobed-db and
    # make LSMOD=$HOME/.config/modprobed.db localmodconfig
    configfile = ./config;

    kernelPatches = [
      {
        name = "BORE CPU scheduler";
        patch = pkgs.fetchurl {
          url =
            "https://raw.githubusercontent.com"
            + "/firelzrd/bore-scheduler"
            + "/main/patches/stable"
            + "/linux-6.6-bore/0001-linux6.6.y-bore5.1.0.patch";
          hash = "sha256-iLydPGZZSkEQhSj6Ah0Xq0zf7YUPwcpyKt8t0BeHYz8=";
        };
      }
      {
        name = "Native CPU optimizations";
        patch = pkgs.fetchurl {
          url =
            "https://raw.githubusercontent.com"
            + "/graysky2/kernel_compiler_patch"
            + "/master/more-uarches-for-kernel-6.1.79-6.8-rc3.patch";
          hash = "sha256-Gjglt5BBPQmAbJohFfZ5vijkNM/MacAdwGm2NNHoAHo=";
        };
        extraStructuredConfig = with lib.kernel; {
          GENERIC_CPU = mkForce no;
          MZEN3 = mkForce yes;
        };
      }
    ];
  });
```
steps:
- build and reboot
- `cat /proc/config.gz | zgrep MZEN3` outputs CONFIG_MZEN3 is not set

### Expected behavior
Output should be: CONFIG_MZEN3=y

